import React from "react";


function add() {

    let result = 40 + 4;
    return result;

}
function sub() {
    let result = 40 - 4;
    return result;
}
function div() {
    let result = 40 / 4;
    return result;

}
function mul() {
    let result = 40 * 4;
    return result;

}

export default {add,sub,mul,div};
